import React, {Component} from "react";

export default class Footer extends Component {
    /*
        Include:
        Back to top of page link
        Help section - link to returns
        Social Media Links
        Copyright
     */

    render() {
        return (
            <div>
                <footer>
                    <div className={"footer-container"}>
                        <h2>Customer Care</h2>
                        <h3>Returns</h3>
                        <h3>Help & Contact Us</h3>
                    </div>
                </footer>
            </div>
        )
    }
}
